import React, { Component } from "react";
import { Cards } from "./Cards";
import { Card } from "./Card";
import DogService from "../../services/Dog.service";

export default class Main extends Component {

  constructor(props){
    super(props);
    this.state = {dogs: []};
  }

  componentDidMount(){
    DogService.getAllBreeds()
    .then((data) => this.setState({dogs:data.results}))
    .catch((error) => console.log(error));
  }

  render() {
    return (
      <main>
        <section className="py-5 text-center container">
          <div className="row py-lg-5">
            <div className="col-lg-6 col-md-8 mx-auto">
              <h1 className="fw-light">DOGGY´S WORLD</h1>
              <p className="lead text-body-secondary">
              "¡Bienvenidos a la Guarida de DOGGY´S: Donde la Cola Nunca Deja de Moverse y los Lametazos 
              son Moneda Corriente!"
              </p>
              <p>
                <a href="#" className="btn btn-primary my-2">
                  Main call to action
                </a>
                <a href="#" className="btn btn-secondary my-2">
                  Secondary action
                </a>
              </p>
            </div>
          </div>
        </section>

        {/* <Cards/>  */}

        <Cards mascotas={this.state.dogs} /> 


      </main>
    );
  }
}
